import { useState, useEffect } from "react";
import axios from "axios";

function Pacients() {
  const [users, setUsers] = useState([]);
  return (
    <div>
      <div>
        <input type="text" id="pacientSearch" placeholder="Search pacient " />
        <button type="button" class="btn btn-success">
          Search
        </button>
      </div>
      <div class="table-responsive">
        <table class="table">
          <thead>
            <tr>
              <th>First Name</th>
              <th>Last Name</th>
              <th>Email</th>
              <th>CNP</th>
            </tr>
          </thead>
          <tbody></tbody>
        </table>
      </div>
    </div>
  );
}

export default Pacients;
